    false,nt"url": null,nt"notes": "The project as described was to remove
    all saltcedar (Tamarix spp.) from selected areas of McNary and Columbia Refuges
    and the Hanford Reach National Monument, and to control saltcedar on additional
    selected areas on the Monument.  Saltcedar is a non-native shrubby tree that can
    significantly degrade native habitats and/or prevent native vegetation from establishing
    or recolonizing following a disturbance.  It has little to no forage value, can
    significantly alter hydrology and soil pH, and often forms near monocultures with
    little to no native understory.  Plants will be treated through cut stump and a
    50% solution of triclopyr (plus adjuvants).",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
